// Marks.js
import { line, curveNatural } from 'd3';

export const Marks = ({
    data,
    xScale,
    yScale,
    xValue,
    yValue,
    circleRadius
}) => {
    // Check for valid data
    if (!data || data.length === 0) {
        console.warn("No data available for rendering!");
        return null; // Prevent rendering if data is empty
    }

    // Check the values being passed
    console.log("Data in Marks:", data);

    // const linePath = line()
    //     .x((d) => xScale(xValue(d))) // X position based on Timestamp
    //     .y((d) => yScale(yValue(d))) // Y position based on HRV
    //     .curve(curveNatural); // Smooth line

    return (
        <g className="marksline">
            {/* <path
                fill="none"
                stroke="black"
                // d={linePath(data)} // Draw the line
            /> */}
            {data.map((d, index) => (
                <circle
                    key={index}
                    cx={xScale(xValue(d))}
                    cy={yScale(yValue(d))}
                    r={circleRadius}
                    fill="red"
                    stroke="black"
                />
            ))}
        </g>
    );
};
